import React from "react";
import "./style.css";

function SortButtons() {
  return (
      <div>
          <button type="button" class="btn btn-primary" onClick={() => props.sortID()}>Sort by ID</button>
          <button type="button" class="btn btn-secondary">Sort by Name</button>
          <button type="button" class="btn btn-success">Sort by DOB</button>
      </div>
  )
}

export default SortButtons;
